import React from "react";
import "../../Styles/Shared/HomeCard.scss";
import MyButton from "../../Components/Shared/MyButton";
import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";

function HomeCard() {
  return (
    <div className='homeCard'>
      <h4>Battle Arena: Legends</h4>
      <p>
        The most insane, immersive battle yet. Every battle is different and
        unique.{" "}
      </p>
      <div className='homeCard__price'>
        <span class='old-price'>123$</span>
        <h5>63$</h5>
      </div>
      <MyButton icon={ShoppingCartIcon} name='Buy now' />
    </div>
  );
}

export default HomeCard;
